4. A qui est destinée la plateforme MOALIM ? La plateforme MOALIM est destinée aux :
- Élèves :
  - Collège : 5 AP
  - Collège : 1AM 4 AM
  - Lycée : 1AS 3 AS (L’offre est destinée uniquement à la branche scientifique)
- Parents ;
- Enseignants, écoles, etc. 5. Quelles sont les bénéfices offerts avec la plateforme MOALIM ? La plateforme MOALIM offre plusieurs avantages :
- 100% Confiance en soi :
  - L’autonomie de l’apprenant ;
  - Suivi parental sans stress ;
  - L’amélioration des résultats scolaires ;
  - Visibilité sur les progrès réalisés : en temps réels. - 10 fois - chers / 10 fois + efficace :
  - Sans connaissance du programme scolaire ;
  - Temps et charge de travail optimisée ;
  - Coûts réduits ;
  - Sans déplacements. - 100% Disponibilité du contenu :
  - 7j/7j
  - 24h/24h
  - Contenu illimité
6. Quels sont les offres MOALIM conçues pour l’année scolaire 2023/2024 ? Plusieurs offres sont programmées pour l’année scolaire 2023/2024 :
- Offre Moalim trimestrielle et annuelle ;
- Pack J’MChallenge Trimestriel ;
- Pack J’Mévalue Annuel. 7. En quoi consiste le programme J’MChallenge ? Le programme J’MChallenge de Moalim est conçu pour offrir une série d'activités, qui apportent une grande valeur ajoutée, à la fois aux acquis scolaires des élèves et à leur niveau de culture générale. Il propose diverses activités conformes à l’approche par compétences, de manière ludique. Ce programme est destiné aux :
- Primaire : 5 AP
- Collèges : 1AM 4 AM
- Lycée : 1AS 3 AS
8. Quels sont les bénéfices du programme J’MChallenge ? Les bénéfices du programme J’MChallenge, sont :
- Apprendre de nouvelles connaissances ;
- Développer le sens « Ingénieur » de l’élève ;
- Développer de nouvelles compétences ;
- Concentration ;
- La production écrite et communication ;
- La compréhension du texte ;
- Apprendre à résoudre un problème ;
- Développer l’esprit « citoyens utile » ;
- Projets technologie ;
- Reportage Médiatique. 9. En quoi consiste le programme J’Mévalue ? Le programme J’Mévalue de Moalim, offre un contenu spécialement conçu pour une évaluation continue tout au long de l’année scolaire. Il est destiné aux :
- Collèges : 1AM 4 AM
- Lycée : 1AS 3 AS
Ce programme vise à accompagner les élèves pour :
- Réviser les matières essentielles nécessaires, afin d’entamer la nouvelle année scolaire de manière solide ;
- S’évaluer à tout moment, dans chaque cours ;
- Détecter rapidement les lacunes et les combler ;
- Se préparer aux examens de fin de trimestre et au BAC & BEM.
